import './App.css';
import React from 'react';
import {BrowserRouter as Router, Route, Routes} from "react-router-dom";
import Header from './front/Header';
import Footer from './front/Footer';
import {Home} from './front/Home';
import {Login} from './front/Login';
import {Registration} from './front/Registration';
import {Forgotpassword} from './front/Forgotpassword';
import {PasswordResetting} from './front/PasswordResetting';
import {JobListing} from './front/JobListing';
import {AddNewJobPost} from './front/AddNewJobPost';
import {CreateNewPost} from './front/CreateNewPost';
import {JobHome} from './front/JobHome';
import {JobDetails} from './front/JobDetails';
import {ApplySuccess} from './front/ApplySuccess';
import {AddJobDocument} from './front/AddJobDocument';
import {Chats} from './front/Chats';
import {AddChatContact} from './front/AddChatContact';
import {ChatsSettings} from './front/ChatsSettings';
import {SpammedChats} from './front/SpammedChats';
import {PrivateChat} from './front/PrivateChat';
import {GroupChat} from './front/GroupChat';
import {AudioChat} from './front/AudioChat';
import {VideoChat} from './front/VideoChat';
import {AudioChatCalling} from './front/AudioChatCalling';
import {GroupAudioChat} from './front/GroupAudioChat';

function App() {
  return (
    <div className="App">
      <Router>
      <Header />     
        <Routes>
          <Route path="/" element={<Home />}></Route>
          <Route path="/Login" element={<Login />}></Route>
          <Route path="/Registration" element={<Registration />}></Route>
          <Route path="/Forgotpassword" element={<Forgotpassword />}></Route>
          <Route path="/PasswordResetting" element={<PasswordResetting />}></Route>
          <Route path="/JobListing" element={<JobListing />}></Route>
          <Route path="/AddNewJobPost" element={<AddNewJobPost />}></Route>
          <Route path="/CreateNewPost" element={<CreateNewPost />}></Route>
          <Route path="/JobHome" element={<JobHome />}></Route>
          <Route path="/JobDetails" element={<JobDetails />}></Route>
          <Route path="/ApplySuccess" element={<ApplySuccess />}></Route>
          <Route path="/AddJobDocument" element={<AddJobDocument />}></Route>
          <Route path="/Chats" element={<Chats />}></Route>
          <Route path="/AddChatContact" element={<AddChatContact />}></Route>
          <Route path="/ChatsSettings" element={<ChatsSettings />}></Route>
          <Route path="/SpammedChats" element={<SpammedChats />}></Route>
          <Route path="/PrivateChat" element={<PrivateChat />}></Route>
          <Route path="/GroupChat" element={<GroupChat />}></Route>
          <Route path="/AudioChat" element={<AudioChat />}></Route>
          <Route path="/VideoChat" element={<VideoChat />}></Route>
          <Route path="/AudioChatCalling" element={<AudioChatCalling />}></Route>
          <Route path="/GroupAudioChat" element={<GroupAudioChat />}></Route>
        </Routes>        
    </Router>
    </div>
  );
}

export default App;
